  blueprint_courses_is_an_account_level_feature_opti_38676924: "Blueprint-kurser är ett funktionsalternativ på kontonivå. Kursroller kan endast hantera blueprint-kurser om de läggs till i blueprint-kursen med lärar-, TA- eller designerroll. Om du vill öppna sidofältet blueprint-kurser måste Kurser – lägg till/redigera/ta bort kurser vara aktiverad. Om du vill lägga till en kopplad kurs måste även Kurser – visa lista och Kurser – lägg till/redigera/ta bort vara aktiverad. Om du vill redigera låsinställningar på blueprint-objekttyper måste även Kurser – lägg till/redigera/ta bort vara aktiverad."
  blueprint_courses_is_an_account_level_feature_opti_3bf307d: "Blueprint-kurser är ett funktionsalternativ på kontonivå. Om du vill redigera låsinställningarna på indexeringssidan Diskussioner måste även Kurser – lägg till/redigera/ta bort och Diskussioner – visa vara aktiverad. Om den här behörigheten inte är aktiverad och Kurser – lägg till/redigera/ta bort och Diskussioner – visa är aktiverad, kan blueprint-låsinställningar redigeras för enskilda diskussioner."
  blueprint_courses_is_an_account_level_feature_opti_4c9fa399: |-
      Blueprint-kurser är ett funktionsalternativ på kontonivå.
      Om du vill redigera låsinställningarna från indexeringssidan Uppgifter måste även Kurser – lägg till/redigera/ta bort vara aktiverad. Om den här behörigheten inte är aktiverad och Kurser – lägg till/redigera/ta bort är aktiverad, kan blueprint-låsinställningar för en uppgift hanteras från uppgiftens informationssida.
      Om du vill redigera låsinställningarna på ett enskilt quiz, eller på indexeringssidan Quiz, måste även Kurser – lägg till/redigera/ta bort vara aktiverad.
  blueprint_courses_is_an_account_level_feature_opti_580ba84e: |-
      Blueprint-kurser är ett funktionsalternativ på kontonivå.
      Om du vill redigera låsinställningarna från indexeringssidan Sidor måste även Kurser – lägg till/redigera/ta bort vara aktiverad. Om den här behörigheten inte är aktiverad och Kurser – lägg till/redigera/ta bort och Diskussioner – visa är aktiverad, kan blueprint-låsinställningar redigeras på enskilda sidor.
  blueprint_courses_is_an_account_level_feature_opti_8429207: "Blueprint-kurser är ett funktionsalternativ på kontonivå. Om du vill redigera blueprint-kursinställningar måste även blueprint-kurser – lägg till/redigera/ta bort vara aktiverad. Om du vill lägga till en kopplad kurs måste även blueprint-kurser – lägg till/redigera/ta bort och Kurser – visa lista vara aktiverade. Om du vill redigera låsinställningar på blueprint-objekttyper måste den här behörigheten vara aktiverad. Om du vill redigera låsinställningarna på filer måste även Kursfiler – lägg till/redigera/ta bort vara aktiverad. Om du vill redigera låsinställningarna för quiz måste även Uppgifter och Quiz – lägg till/redigera/ta bort vara aktiverad."
  blueprint_courses_is_an_account_level_feature_opti_a90144eb: |-
      Blueprint-kurser är ett funktionsalternativ på kontonivå.
      
      Om du vill lägga till kopplade kurs måste även blueprint-kurser – lägga till/redigera/koppla/ta bort och Kurser – lägg till/redigera/ta bort vara aktiverade.
