      Kursroller kan endast hantera blueprint-kursinnehåll om de läggs till i blueprint-kursen med lärar-, TA- eller designerroll.
      
      Om du vill redigera låsinställningarna från indexeringssidan Diskussioner måste även Diskussioner – moderera vara aktiverad.
  blueprint_courses_must_be_enabled_for_an_account_b_79b2d93e: |-
