      labels: 
        eportfolio_name: "ePortfolio Namn"
        make_public: "Gör det offentlig"
      links: 
        create: "Skapa en ePortfolio"
      page_title: "Mina ePortfolios"
      what: 
        details1: |-
            ePortfolios är en plats där du kan visa och diskutera viktiga
            inlämningar och erfarenheter som hände under din inlärningsprocess.
            Du kan använda en ePortfolio till att:
            
            * Visa arbeten som du är stolt över eller om du vill visa dem för fler personer än bara läraren.
            * Dela dina tankar och det arbete du lagt ner på dina inlämningar
            * Får en översikt över dina inlärningsupplevelser
            * Dela dina arbeten med vänner, framtida arbetsgivare, etc.
            
            ePortfolios kan vara offentliga för alla, eller privata så att endast
            utvalda ska kunna se dem, och du kan ändra den inställningen när du vill.
            
            Är du redo att komma igång? Klicka på knappen.
    wizard_box: 
      finish: 
        body: "Är du redo att sätta igång? Du kan alltid gå tillbaka till wizard från sidor genom att klicka på \"%{help_link_text}\" länken du ser här."
      headers: 
        finish: "Då kör vi"
        getting_started: "Komma igång"
        instructions: "Använda en ePortfolio"
        introduction: Introduktion
        page_content: Sidinnehåll
        pages: Sektionssidor
        sections: Portfoliosektioner
        settings: ePortfolio-inställningar
        submissions: "Lägga till inlämningar"
      introduction: 
        body: "ePortfolios är en plats där du kan visa ditt arbete. De består av sektioner och sidor. Lista med sektioner är placerad på vänster sida av fönstret (%{showme1}). Varje sektion kan ha flera sidor, sidorna visas på höger sida av fönstret (%{showme2})."
      links: 
        portfolio: "Visa portfolion"
      page_content: 
        body1: "Innehållet du ser på en sida är samma innehåll som alla besökare ser. För att redigera det här innehållet trycker du på ”%{edit_link_text}” länken (%{showme}) och sidan kommer ändras till redigeringsmode."
        body2: "Nu redigerar du! Om du vill kan du döpa om en sida eller ändra kommentarsalternativen (%{showme1}). Du kan spara, förhandsvisa eller avbryta dina ändringar när du vill genom att klicka på knappen till höger (%{showme2})."
        body3: "Innehållet är uppdelat i undersektioner, varje undersektion har en prickad avgränsning. Du kan radera eller redigera innehållet i alla undersektioner genom att klicka på %{edit_icon} eller %{delete_icon} ikonerna i det övre högra hörnet."
        body4: "För att lägga till nya undersektioner måste du hitta och klicka på den sortens innehåll du vill lägga till, detta gör du i alternativs listan till höger på sidan (%{showme})."
      pages: 
        body1: "Sektioner har flera sidor. Du kan se en lista av sidorna i den nuvarande sektionen till höger i fönstret (%{showme1}). För att organisera eller lägga till sidor klickar du på \"%{manage_pages}\" länken (%{showme2})."
        body2: "Du kan döpa om alla sidor genom att klicka på %{edit_icon} ikonen, radera sidor genom att klicka på %{delete_icon} ikonen, eller arrangera om sidordningen genom att klicka och dra dem."
      sections: 
        body1: "En lista med sektionerna finns till vänster i fönstret (%{showme1}). Varje sektion kan ha flera sidor i sig. För att organisera eller lägga till sektioner klickar du på \"%{manage_sections}\" länken (%{showme2})."
        body2: "Du kan döpa om alla sektioner genom att klicka på %{edit_icon} ikonen, arrangera om sektionerna genom att klicka och dra dem, eller radera sektioner genom att klicka på %{delete_icon} ikonen."
      settings: 
        body: "För att ändra dina ePortfolio-inställningar klickar du på \"ePortfolio-inställningar\" länken  (%{showme}). Du kan döpa om din portfolio samt ändra om den är privat eller offentlig. Privata portfolios är endast tillgängliga för de som du har gett behörighet till."
      submissions: 
        body1: "Du har kanske märkt att det längst ner på sidan finns en lista med nyliga inlämningar från dina klasser (%{showme}). Du kan snabbt och enkelt lägga till inlämningar till en ny sida i din portfolio, direkt från den här sidan. Det är bara att klicka på inlämningen du vill lägga till och en dialog kommer synas."
        body2: "Perfekt! Nu kan du lägga till inlämningar, du måste först välja vilken sektion du vill lägga till i och sen ge sidan ett namn. Därefter klickar du på \"Lägg till sida\" och du kommer tas till en ny sida där du kan redigera detaljer."
