    grade_export: 
      description: "Export av bedömningar till SIS"
      name: "Export av bedömningar"
    grade_export_settings: 
      description: |-
          Den här pluginen tillåter att slutbedömningar publiceras tillbaka på en elevs informationssystem (SIS). När den aktiveras kommer användaren få ett alternativ att publicera bedömningarna när den besöker bedömningsöversikten. Detta kommer ske med en POST-begäran att specificera publiceringens slutpunkt. Varje typ definierar sitt eget innehåll och mimtyp. Slutpunktens svar spelar ingen roll och ignoreras för tillfället.
          
          Till exempel, den Instructure formaterade CSV kommer POSTa en csvfil med mimtyp 'text/csv' till en specifik slutpunkt, men följande kolumner:
          
          "publisher_id", "publisher_sis_id", "course_id", "course_sis_id", "section_id", "section_sis_id", "student_id", "student_sis_id", "enrollment_id", "enrollment_status",
          "resultat", "bedömning"
          
          (Observera: "bedömning" - kolumnen kommer endast skickas tillbaka om kursen har en specificerad bedömningsstandard)
          
          För varje elev i kursen som publiceras kommer det finnas 1 eller fler rader i den publicerade csv. Det kommer finnas 1 rad för varje inloggning som den eleven har i kursens root-kontot. Det kommer oftast resultera i 1 rad, fast om eleven har flera inloggningar kommer det finna en rad för varje.
      labels: 
        format_type: "Output formatstyp"
        publish_endpoint: "Slutpunkt att publicera till"
